import React from 'react';

//functional component
const NewsList = (props) =>{

    const items = props.news.map((item)=>{
        return(
            <div>
                <h3>{item.title}</h3>
            </div>
        )
    });
    console.log(props)
    return (
        <div>
            items
        </div>
    )
};

export default NewsList;
